import React from "react";
import Card from "./Card";
import Ldata from "./Ldata";
const FrontEnd = () => {
    return (
        <Card key={Ldata[0].id} images={Ldata[0].img} title={Ldata[0].title} type={Ldata[0].type}/>
    )
}

export default FrontEnd;
